DROP DATABASE IF EXISTS db_spotify;

CREATE DATABASE db_spotify;
USE db_spotify;

CREATE TABLE tb_musicas
(
	id_musica INT PRIMARY KEY AUTO_INCREMENT,
    nm_musica VARCHAR(255) NULL,
    nm_artistas VARCHAR(255) NULL,
    nm_album VARCHAR(255) NULL,
    nm_genero VARCHAR(255) NULL,
    nr_popularidade INT NULL,
    vl_dancabilidade DECIMAL(18, 2) NULL,
    vl_instrumentabilidade DECIMAL(18, 2) NULL,
    dt_cadastro DATETIME NOT NULL,
    bt_ativo BOOLEAN NOT NULL DEFAULT 1
);

